import ClassificaStyle from './Classifica.module.css'
import { useState } from 'react'


const Classifica = () => {

    const [datiClassifica, changeDatiClassifica] = useState([])

    const FdatiClassifica = async () => {
        const response = await fetch("https://v3.football.api-sports.io/standings?league=39&season=2019", {
        "method": "GET",
        "headers": {
        "x-rapidapi-host": "v3.football.api-sports.io",
        "x-rapidapi-key": "353b6d4834b3e467f904d41caf26e4fc"
        }
        })
        if(!response.ok){
        //    
        }else{
        const data = await response.json()
        console.log(data)
        changeDatiClassifica(data.response)
        }}

    // const stileTi = ClassificaStyle.stileTi 
    // const stileSel = BigCardStyle.stileSel
    // const stileSel1 = BigCardStyle.stileSel1

    const stileTi1 = ClassificaStyle.stileTi1

return(
<>
<div className='col-12 d-flex align-items-center'>
<div className='col-6 px-2'>Classifica finale</div>
<div className='col-6 px-2'>
<select onChange={FdatiClassifica} className={`form-select`} aria-label="Default select example">
  <option selected>Stagione</option>
  <option value="1">One</option>
  <option value="2">Two</option>
  <option value="3">Three</option>
</select>
</div>
</div>
{datiClassifica.map( dato => 
<>
<div className='d-flex col-12 mt-3'>
<div className='col-1'></div>
<div className={`col-3 ${stileTi1}`}>Squadra</div>
<div className={`col-1 text-center ${stileTi1}`}>PG</div>
<div className={`col-1 text-center ${stileTi1}`}>V</div>
<div className={`col-1 text-center ${stileTi1}`}>P</div>
<div className={`col-1 text-center ${stileTi1}`}>S</div>
<div className={`col-1 text-center ${stileTi1}`}>GF</div>
<div className={`col-1 text-center ${stileTi1}`}>GS</div>
<div className={`col-1 text-center ${stileTi1}`}>DR</div>
<div className={`col-1 text-center ${stileTi1}`}>PT</div>
</div>

<div className='d-flex col-12'>
<div className='col-1 text-center'>dato.standings.rank</div>
<div className='col-3 d-flex overflow-auto'>
<div><img style={{'width': '16px'}} src='#' alt='logo'></img></div> 
<div className='ps-2 text-nowrap'>Boca Juniors</div>
</div>
<div className='col-1 text-center'>34</div>
<div className='col-1 text-center'>20</div>
<div className='col-1 text-center'>10</div>
<div className='col-1 text-center'>4</div>
<div className='col-1 text-center'>80</div>
<div className='col-1 text-center'>14</div>
<div className='col-1 text-center'>66</div>
<div className='col-1 text-center'>70</div>
</div>
</>
)}
</>
)};

export default Classifica;
